$(document).ready(function(){$(".swal-confirm").click(function(t){t.preventDefault();var n=$(this).data("swtitle"),e=$(this).data("swmessage"),o=$(this).parents(o);swal({title:n,text:e,type:"warning",showCancelButton:!0,confirmButtonColor:"#DD6B55",confirmButtonText:"Yes, I am sure!",cancelButtonText:"No, cancel!"}).then(function(t){o.submit()},function(t){return!1}).catch(swal.noop)}),$("body").niceScroll(),$("#media-modal-info").niceScroll()});